import Navbar from './components/Navbar';
import { Route, Routes } from 'react-router-dom';


function App() {


    
    return (
        <div id="main-container">
            <Navbar/>

            <Routes>
                <Route path = "/" element={<Home/>} />
                <Route path ="/Categories" element={<Categories />} />
                <Route path = "/Suppliers" element={<Suppliers />}/> 
            </Routes>

