                !error ? books &&
                    books.map(
                        (element) => {
                            return <Book
                                key={element.id}
                                id={element.id}
                                title={element.title}
                                author={element.author}
                                price={element.price}
                                handleRemove={handleRemove}
                                books={books}
                                setBooks={setBooks}
                            >
                            </Book>
                        }
                    )
                    :
                    error
            }
        </div>
    );
}

export default App;
